import React from "react";
import '../stylesheets/nav-button.css';

export function Navutton({ text , isLogged , manageClick}){
  return(
    <button 
      className={ isLogged ? 'my-account-button' : 'login-button' }
      onClick={ manageClick }>
      {text}
    </button>
  );
}
